sap.ui.define(["sap/ui/test/opaQunit","../pages/Common","../pages/app/AppList","../pages/app/ViewApp","../pages/app/AddApp","../pages/app/EditApp"],function(e){"use strict";QUnit.module("Add App");e("Pressing the New Application button should show the new application screen",function(e,p,t){p.onTheAppListPage.iPressAddNewApplication();t.onTheAddAppPage.iShouldSeeTheAddAppScreen()});e("Creating a new app",function(e,p,t){p.onTheAddAppPage.iEnterText(p.onTheAddAppPage.getPageName(),"idInputAppName",p.onTheAppListPage.getAppName()).iEnterText(p.onTheAddAppPage.getPageName(),"idInputUsageTrackingId","1221762761").iEnterText(p.onTheAddAppPage.getPageName(),"idDatePickerGoLive","Feb 20, 2020").iEnterText(p.onTheAddAppPage.getPageName(),"idDatePickerRetired","Feb 20, 2020").iEnterText(p.onTheAddAppPage.getPageName(),"idTextNotes","Test Note").iSelectAKey(p.onTheAddAppPage.getPageName(),"idSelectStatus","Productive").iSelectAKey(p.onTheAddAppPage.getPageName(),"idSelectTechnology","iOS").iSelectAKey(p.onTheAddAppPage.getPageName(),"idSelectCategory","Sales").iPressSave(p.onTheAddAppPage.getPageName());t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("Pressing the Cancel New Application button should show the new screen",function(e,p,t){p.onTheAppListPage.iPressAddNewApplication();t.onTheAddAppPage.iShouldSeeTheAddAppScreen();p.onTheAddAppPage.iPressCancel(p.onTheAddAppPage.getPageName());t.onTheAppListPage.theTableHasEntries(p.onTheAppListPage.getPageName(),"idTableApps")});QUnit.module("Search App");e("Entering something that cannot be found into search field and pressing search field's refresh should leave the list as it was",function(e,p,t){p.onTheAppListPage.iTypeSomethingInTheSearchThatCannotBeFoundAndTriggerRefresh();t.onTheAppListPage.theTableHasEntries(p.onTheAppListPage.getPageName(),"idTableApps")});e("Entering something that cannot be found into search field and pressing 'search' should display the list's 'not found' message",function(e,p,t){p.onTheAppListPage.iSearchForSomethingWithNoResults();t.onTheAppListPage.iShouldSeeTheNoDataTextForNoSearchResults()});e("Should display items again if the searchfield is emptied",function(e,p,t){p.onTheAppListPage.iClearTheSearch();t.onTheAppListPage.theTableHasEntries(p.onTheAppListPage.getPageName(),"idTableApps")});QUnit.module("View App");e("Selecting the new application in the app list",function(e,p,t){p.onTheAppListPage.iSearchFor(p.onTheAppListPage.getAppName());t.onTheAppListPage.theTableHasEntries(p.onTheAppListPage.getPageName(),"idTableApps");p.onTheAppListPage.iPressOnTheObjectAtPositionInTable(p.onTheAppListPage.getPageName(),"idTableApps",0);t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("Validate the new data matches the data used to create the records",function(e,p,t){t.onTheAppListPage.theTableHasEntries(p.onTheAppListPage.getPageName(),"idTableApps");t.onTheViewAppPage.iShouldSeeTheText(p.onTheViewAppPage.getPageName(),"usageTrackingId","1221762761");t.onTheViewAppPage.iShouldSeeTheText(p.onTheViewAppPage.getPageName(),"idTextGoLive","02/20/2020");t.onTheViewAppPage.iShouldSeeTheText(p.onTheViewAppPage.getPageName(),"idTextRetired","02/20/2020")});QUnit.module("Edit App");e("Pressing edit app I should see the edit form",function(e,p,t){p.onTheViewAppPage.iPressOnEditApplication();t.onTheEditAppPage.iShouldSeeTheEditAppScreen()});e("Changing a field should update that field",function(e,p,t){p.onTheEditAppPage.iEnterText(p.onTheEditAppPage.getPageName(),"idTextNotes","New Note").iPressSave(p.onTheEditAppPage.getPageName());t.onTheViewAppPage.iShouldSeeTheAppInfoScreen();t.onTheViewAppPage.iShouldSeeTheText(p.onTheViewAppPage.getPageName(),"idTextNotes","New Note")});e("Pressing the Cancel Edit Application button should show the view screen",function(e,p,t){p.onTheViewAppPage.iPressOnEditApplication();t.onTheEditAppPage.iShouldSeeTheEditAppScreen();p.onTheEditAppPage.iPressCancel(p.onTheEditAppPage.getPageName());t.onTheViewAppPage.iShouldSeeTheAppInfoScreen()});e("Pressing the Close View Application should show the application table",function(e,p,t){p.onTheViewAppPage.iPress(p.onTheViewAppPage.getPageName(),"idButtonCloseApp");t.onTheAppListPage.iShouldSeeTheControl(p.onTheAppListPage.getPageName(),"idTableApps")})});